import { Accordion, AccordionSummary, AccordionDetails, Typography, makeStyles } from '@material-ui/core'
import { ExpandMore } from '@material-ui/icons'
import React, { Component } from 'react'
import InsurerOverview from './Components/Insurer/InsurerOverview.web'
import LockIcon from '@material-ui/icons/Lock';

const useStylesFunction = makeStyles({
    accordianHeading: {
        fontWeight: 600,
        display: 'flex',
        alignItems: 'center',
    },
    lockedAccordion: {
        padding: '6px 10px',
        backgroundColor: '#e9f4f9',
        border: '1px solid #ccc',
        borderRadius: '4px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        margin: '0px 8px',
        '& svg': {
            marginRight: '6px',
        }
    }

})

type accordionTitleProps = {
    title: string,
    // insuranceData: any,
}

const AccordionTitle = (props: accordionTitleProps) => {
    const classes = useStylesFunction()
    return (
        <Typography className={classes.accordianHeading}>
            {props?.title}
            {
                // props?.insuranceData === null ? (
                    <div className={classes.lockedAccordion}>
                        <LockIcon /> Please select insurance type to unlock  this fields
                    </div>
                // ) : null
            }

        </Typography>
    )
}

export default class SalesReview extends Component {
  render() {
    return (
      <div>

        <Accordion>
                                <AccordionSummary
                                    aria-expanded={true}
                                    expandIcon={<ExpandMore />}
                                    aria-controls="Insurers"
                                    id="Insurers"
                                >
                                    <AccordionTitle title='Overview' />
                                </AccordionSummary>
                                <AccordionDetails>
                                    {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}
                                <h1>asdbnjhb</h1>
                                </AccordionDetails>
                            </Accordion>
      </div>
    )
  }
}
